import React, { Component } from 'react';

class Slides extends Component {

  getImages() {
    const { images } = this.props;
    if(images && images > 0) {
      images.forEach((item) => {
        return ( <img alt='' src={require(item.largeImageURL)} /> )
      })
    }
  }

  render () {
    return (
      <div className="slide"></div>
    );
  }
}

export default Slides;
